  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Gulf Island National
  Wildlife Refuges (Petit Bois National Wildlife Refuge, Horn Island National Wildlife
  Refuge, and Breton National Wildlife Refuge) outlines Refuge accomplishments from
  January through April of 1962. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover during this period. Wildlife-
  including migratory birds, upland game birds, furbearers, predators, rodents, mammals,
  raptors, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and safety. Items of interest
  and N-R forms and photographs are attached.\",\n\t\"license_title\": \"License Not
